import React from 'react';
import './App.css';
import './index.css';
import Circle from './Circle.js';
import GameOver from './GameOver.js';
import Score from './Score.js';


const App = () => {
  return (
    <div className="App">
      <Circle /> 
      <GameOver /> 
      <Score />
    </div>

  ); 
}

export default App;
